(1256, 122, 102, 0, 'Traditionally, content was edited and tailored for the public through news editors, authors, and other kinds of content creators, however not all information content requires creative authoring or editing. Through recent technological developments, truth is found in philosopher Marshall McLuhan''s idea of a global village; new technologies allow for instantaneous movement of information from every corner to every point at the same time[4] has caused the globe to be contracted into a village by electric technology,[5] such as mobile phones and automated sensors. These new technologies can record events anywhere for publishing and converting in order to potentially reach a global audience on channels such as YouTube. Such recorded or transmitted information and visuals can be referred to as content. Content is no longer a product of only reputable sources; new technology has made primary sources of content more readily available to all (for example, a video of a politician giving a speech compared to an article written by a reporter who witnessed the speech.)', '', '', '', 'PUBLISHED', '2015-08-28 05:32:38', '', '2015-08-28 05:32:38', '2015-08-27 18:32:41');
