(1259, 122, 102, 0, '<p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: 22.3999996185303px; color: rgb(37, 37, 37); font-family: sans-serif;">Content itself is what the end-user derives value from. Thus, "content" can refer to the information provided through the medium, the way in which the information was presented, as well as the added features included in the medium in which that information was delivered. The medium however, provides little to no value to the end-user without the information and experiences that make up the content.&nbsp;<a href="https://en.wikipedia.org/wiki/Communication_theory" title="Communication theory" style="color: rgb(11, 0, 128); background-image: none;">Communication theory</a>&nbsp;philosopher&nbsp;<a href="https://en.wikipedia.org/wiki/Marshall_McLuhan" title="Marshall McLuhan" style="color: rgb(11, 0, 128); background-image: none;">Marshall McLuhan</a>&nbsp;famously coined the phrase, "<a href="https://en.wikipedia.org/wiki/The_medium_is_the_message" title="The medium is the message" style="color: rgb(11, 0, 128); background-image: none;">The medium is the message</a>."<sup id="cite_ref-3" class="reference" style="line-height: 1; font-size: 11.1999998092651px; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Content_(media)#cite_note-3" style="color: rgb(11, 0, 128); white-space: nowrap; background-image: none;">[3]</a></sup>&nbsp;In the case of content, the channel through which information is delivered, the "medium", affects how the end user perceives content, the "message".</p><p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: 22.3999996185303px; color: rgb(37, 37, 37); font-family: sans-serif;">The author, producer or publisher of an original source of information or experiences may or may not be directly responsible for the entire value that they attain as content in a specific context. For example, part of an original article (such as a headline from a news story) may be rendered on another web page displaying the results of a user''s search engine query grouped with headlines from other news publications and related advertisements. The value that the original headline has in this group of query results from the search engine as a medium may be very different from the value that it had as message content in its original article.</p><p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: 22.3999996185303px; color: rgb(37, 37, 37); font-family: sans-serif;">Content also leads to influencing other people in creating their own content, sometimes in a way that the original author didn''t or couldn''t plan or imagine. This feature adding the option of&nbsp;<a href="https://en.wikipedia.org/wiki/User_innovation" title="User innovation" style="color: rgb(11, 0, 128); background-image: none;">user innovation</a>&nbsp;in a medium means users can develop their own content from existing content.<span style="line-height: 22.3999996185303px;">Content itself is what the end-user derives value from. Thus, "content" can refer to the information provided through the medium, the way in which the information was presented, as well as the added features included in the medium in which that information was delivered. The medium however, provides little to no value to the end-user without the information and experiences that make up the content.</span><span style="line-height: 22.3999996185303px;">&nbsp;</span><a href="https://en.wikipedia.org/wiki/Communication_theory" title="Communication theory" style="line-height: 22.3999996185303px; color: rgb(11, 0, 128); background-image: none; background-color: rgb(255, 255, 255);">Communication theory</a><span style="line-height: 22.3999996185303px;">&nbsp;</span><span style="line-height: 22.3999996185303px;">philosopher</span><span style="line-height: 22.3999996185303px;">&nbsp;</span><a href="https://en.wikipedia.org/wiki/Marshall_McLuhan" title="Marshall McLuhan" style="line-height: 22.3999996185303px; color: rgb(11, 0, 128); background-image: none; background-color: rgb(255, 255, 255);">Marshall McLuhan</a><span style="line-height: 22.3999996185303px;">&nbsp;</span><span style="line-height: 22.3999996185303px;">famously coined the phrase, "</span><a href="https://en.wikipedia.org/wiki/The_medium_is_the_message" title="The medium is the message" style="line-height: 22.3999996185303px; color: rgb(11, 0, 128); background-image: none; background-color: rgb(255, 255, 255);">The medium is the message</a><span style="line-height: 22.3999996185303px;">."</span><sup id="cite_ref-3" class="reference" style="line-height: 1; font-size: 11.1999998092651px; unicode-bidi: -webkit-isolate;"><a href="https://en.wikipedia.org/wiki/Content_(media)#cite_note-3" style="color: rgb(11, 0, 128); white-space: nowrap; background-image: none;">[3]</a></sup><span style="line-height: 22.3999996185303px;">&nbsp;</span><span style="line-height: 22.3999996185303px;">In the case of content, the channel through which information is delivered, the "medium", affects how the end user perceives content, the "message".</span></p><p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: 22.3999996185303px; color: rgb(37, 37, 37); font-family: sans-serif;">The author, producer or publisher of an original source of information or experiences may or may not be directly responsible for the entire value that they attain as content in a specific context. For example, part of an original article (such as a headline from a news story) may be rendered on another web page displaying the results of a user''s search engine query grouped with headlines from other news publications and related advertisements. The value that the original headline has in this group of query results from the search engine as a medium may be very different from the value that it had as message content in its original article.</p><p style="margin-top: 0.5em; margin-bottom: 0.5em; line-height: 22.3999996185303px; color: rgb(37, 37, 37); 