(1261, 122, 102, 0, 'Content itself is what the end-user derives value from. Thus, "content" can refer to the information provided through the medium, the way in which the information was presented, as well as the added features included in the medium in which that information was delivered. The medium however, provides little to no value to the end-user without the information and experiences that make up the content. Communication theory philosopher Marshall McLuhan famously coined the phrase, "The medium is the message."[3] In the case of content, the channel through which information is delivered, the "medium", affects how the end user perceives content, the "message".\r\n\r\nThe author, producer or publisher of an original source of information or experiences may or may not be directly responsible for the entire value that they attain as content in a specific context. For example, part of an original article (such as a headline from a news story) may be rendered on another web page displaying the results of a user''s search engine query grouped with headlines from other news publications and related advertisements. The value that the original headline has in this group of query results from the search engine as a medium may be very different from the value that it had as message content in its original article.\r\n\r\nContent also leads to influencing other people in creating their own content, sometimes in a way that the original author didn''t or couldn''t plan or imagine. This feature adding the option of user innovation in a medium means users can develop their own content from existing content.', '', '', '', 'PENDING', '2015-08-28 05:39:20', '', '2015-08-28 05:39:20', '2015-08-27 18:39:21'),
